import './App.css';
import React from 'react';
import MainNavbar from "./layout/MainNavbar";
import Employee from "./components/Employee";
import EmployeeClass from "./components/EmployeeClass";

let App = () => {

    return (
        <>
            <MainNavbar/>

            <Employee name="John" age={25} designation="Software Engineer"/>
            <Employee name="Wilson" age={35} designation="Sr.Software Engineer"/>
            <Employee name="Laura" age={45} designation="Project Manager"/>

            <EmployeeClass name="John" age={25} designation="Software Engineer"/>
            <EmployeeClass name="Wilson" age={35} designation="Sr.Software Engineer"/>
            <EmployeeClass name="Laura" age={45} designation="Project Manager"/>
        </>
    );
}

export default App;
